  EmojiEvents,
  Notifications,
  Security,
  Analytics,
  Timeline,
} from '@mui/icons-material';
import { useTheme } from '@mui/material/styles';
import { useNavigate } from 'react-router-dom';
import { landAPI } from '../services/api';

const Dashboard = () => {
  const theme = useTheme();
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    totalLands: 0,
    pendingTransfers: 0,
    completedTransfers: 0,
    totalValue: 0
  });
  const [recentLands, setRecentLands] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const landsResponse = await landAPI.getLands();

      if (landsResponse && landsResponse.data) {
        const lands = landsResponse.data.lands || [];
        setRecentLands(lands.slice(0, 3));

        setStats({
          totalLands: lands.length,
          pendingTransfers: lands.filter(land => land.status === 'pending_transfer').length,
          completedTransfers: lands.filter(land => land.status === 'transferred').length,
          totalValue: lands.reduce((sum, land) => sum + (land.value || 0), 0)
        });
      }
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const LuxuryStatCard = ({ icon: Icon, title, value, subtitle, color, trend }) => (
    <Card
      sx={{
        background: 'linear-gradient(135deg, rgba(255, 215, 0, 0.05) 0%, rgba(229, 228, 226, 0.03) 50%, rgba(12, 12, 12, 0.8) 100%)',
        backdropFilter: 'blur(30px)',
        border: '1px solid rgba(255, 215, 0, 0.2)',
        borderRadius: '20px',
        height: '180px',
        position: 'relative',
        overflow: 'hidden',
        transition: 'all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
        '&:hover': {
          transform: 'translateY(-8px) scale(1.02)',
          boxShadow: `0 20px 40px ${color}30`,
          border: `1px solid ${color}60`,
        },
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          height: '3px',
          background: `linear-gradient(90deg, ${color}, ${color}80, ${color})`,
          opacity: 0.8,
        },
      }}
    >
      <CardContent sx={{ height: '100%', display: 'flex', flexDirection: 'column', justifyContent: 'space-between', p: 3 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
          <Box
            sx={{
              width: 60,
              height: 60,
              borderRadius: '16px',
              background: `linear-gradient(45deg, ${color}20, ${color}10)`,
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              border: `2px solid ${color}30`,
            }}
          >
            <Icon sx={{ fontSize: '2rem', color: color }} />
          </Box>
          {trend && (
            <Chip
              icon={<TrendingUp />}
              label={trend}
              size="small"
              sx={{
                background: `${color}20`,
                color: color,
                border: `1px solid ${color}40`,
                fontWeight: 600,
              }}
            />
          )}
        </Box>

        <Box>
          <Typography
            variant="h3"
            sx={{
              fontWeight: 800,
              background: `linear-gradient(45deg, ${color}, #fff)`,
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              mb: 0.5,
            }}
          >
            {loading ? '...' : value.toLocaleString()}
          </Typography>
          <Typography variant="h6" sx={{ color: 'rgba(255, 255, 255, 0.9)', fontWeight: 600, mb: 0.5 }}>
            {title}
          </Typography>
          {subtitle && (
            <Typography variant="caption" sx={{ color: 'rgba(255, 255, 255, 0.6)' }}>
              {subtitle}
            </Typography>
          )}
        </Box>
      </CardContent>
    </Card>
  );

  const LuxuryWelcomeSection = () => (
    <Paper
      sx={{
        background: 'linear-gradient(135deg, rgba(255, 215, 0, 0.1) 0%, rgba(229, 228, 226, 0.05) 50%, rgba(12, 12, 12, 0.9) 100%)',
        backdropFilter: 'blur(30px)',
        border: '1px solid rgba(255, 215, 0, 0.3)',
        borderRadius: '25px',
        p: 4,
        mb: 4,
        position: 'relative',
        overflow: 'hidden',
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          height: '100%',
          background: 'radial-gradient(circle at 20% 80%, rgba(255, 215, 0, 0.1) 0%, transparent 50%)',
          pointerEvents: 'none',
        },
      }}
    >
      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', position: 'relative', zIndex: 1 }}>
        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          <Avatar
            sx={{
              width: 80,
              height: 80,
              background: 'linear-gradient(45deg, #FFD700, #FFA500)',
              border: '4px solid rgba(255, 215, 0, 0.3)',
              mr: 3,
              animation: 'float 3s ease-in-out infinite',
              '@keyframes float': {
                '0%, 100%': { transform: 'translateY(0px)' },
                '50%': { transform: 'translateY(-8px)' },
              },
            }}
          >
            <Diamond sx={{ fontSize: '2.5rem', color: '#000' }} />
          </Avatar>
          <Box>
            <Typography
              variant="h3"
              sx={{
                fontFamily: 'Playfair Display, serif',
                fontWeight: 700,
                background: 'linear-gradient(45deg, #FFD700 30%, #E5E4E2 70%, #FFD700 90%)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
                mb: 1,
              }}
            >
              Welcome to LuxuryLand
            </Typography>
            <Typography variant="h6" sx={{ color: 'rgba(255, 255, 255, 0.8)' }}>
              Your premium land registry experience awaits
            </Typography>
          </Box>
        </Box>

        <Box sx={{ display: 'flex', gap: 2 }}>
          <Tooltip title="Security Status">
            <IconButton
              sx={{
                background: 'rgba(80, 200, 120, 0.2)',
                border: '1px solid rgba(80, 200, 120, 0.4)',
                color: '#50C878',
                '&:hover': { background: 'rgba(80, 200, 120, 0.3)' },
              }}
            >
              <Security />
            </IconButton>
          </Tooltip>
          <Tooltip title="Analytics">
            <IconButton
              sx={{
                background: 'rgba(185, 242, 255, 0.2)',
                border: '1px solid rgba(185, 242, 255, 0.4)',
                color: '#B9F2FF',
                '&:hover': { background: 'rgba(185, 242, 255, 0.3)' },
              }}
            >
              <Analytics />
            </IconButton>
          </Tooltip>
          <Tooltip title="Notifications">
            <IconButton
              sx={{
                background: 'rgba(224, 17, 95, 0.2)',
                border: '1px solid rgba(224, 17, 95, 0.4)',
                color: '#E0115F',
                '&:hover': { background: 'rgba(224, 17, 95, 0.3)' },
              }}
            >
              <Notifications />
            </IconButton>
          </Tooltip>
        </Box>
      </Box>
    </Paper>
  );

  const ActionCard = ({ icon: Icon, title, description, color, action, path }) => (
    <Card
      onClick={() => navigate(path)}
      sx={{
        background: 'linear-gradient(135deg, rgba(255, 255, 255, 0.02) 0%, rgba(255, 255, 255, 0.01) 100%)',
        backdropFilter: 'blur(20px)',
        border: `1px solid ${color}30`,
        borderRadius: '20px',
        p: 3,
        cursor: 'pointer',
        transition: 'all 0.3s ease',
        '&:hover': {
          transform: 'translateY(-5px)',
          border: `1px solid ${color}60`,
          boxShadow: `0 15px 30px ${color}20`,
          background: `linear-gradient(135deg, ${color}08, ${color}04)`,
        },
      }}
    >
      <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
        <Box
          sx={{
            width: 50,
            height: 50,
            borderRadius: '12px',
            background: `linear-gradient(45deg, ${color}20, ${color}10)`,
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            mr: 2,
          }}
        >
          <Icon sx={{ fontSize: '1.5rem', color: color }} />
        </Box>
        <Box>
          <Typography variant="h6" sx={{ color: '#fff', fontWeight: 600 }}>
            {title}
          </Typography>
        </Box>
      </Box>
      <Typography variant="body2" sx={{ color: 'rgba(255, 255, 255, 0.7)', lineHeight: 1.6 }}>
        {description}
      </Typography>
    </Card>
  );

  if (loading) {
    return (
      <Container maxWidth="xl" sx={{ py: 4 }}>
        <Box sx={{ textAlign: 'center', py: 8 }}>
          <Box
            sx={{
              width: 60,
              height: 60,
              borderRadius: '50%',
              border: '3px solid rgba(255, 215, 0, 0.3)',
              borderTop: '3px solid #FFD700',
              animation: 'spin 1s linear infinite',
              margin: '0 auto 2rem',
              '@keyframes spin': {
                '0%': { transform: 'rotate(0deg)' },
                '100%': { transform: 'rotate(360deg)' },
              },
            }}
          />
          <Typography variant="h6" sx={{ color: '#FFD700' }}>
            Loading your luxury dashboard...
          </Typography>
        </Box>
      </Container>
    );
  }

  return (
    <Container maxWidth="xl" sx={{ py: 4 }}>
      <LuxuryWelcomeSection />

      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <LuxuryStatCard
            icon={Home}
            title="Total Properties"
            value={stats.totalLands}
            subtitle="Registered lands"
            color="#FFD700"
            trend="+12%"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <LuxuryStatCard
            icon={SwapHoriz}
            title="Active Transfers"
            value={stats.pendingTransfers}
            subtitle="Pending transactions"
            color="#E0115F"
            trend="+5%"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <LuxuryStatCard
            icon={EmojiEvents}
            title="Completed"
            value={stats.completedTransfers}
            subtitle="Successful transfers"
            color="#50C878"
            trend="+18%"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <LuxuryStatCard
            icon={TrendingUp}
            title="Portfolio Value"
            value={stats.totalValue}
            subtitle="Total worth"
            color="#B9F2FF"
            trend="+7%"
          />
        </Grid>
      </Grid>

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <ActionCard
            icon={Add}
            title="Register New Property"
            description="Add a new land property to the blockchain registry with complete documentation and verification."
            color="#FFD700"
            path="/register-land"
          />
        </Grid>
        <Grid item xs={12} md={6}>
          <ActionCard
            icon={Visibility}
            title="View Properties"
            description="Browse and manage your complete portfolio of registered land properties with detailed insights."
            color="#50C878"
            path="/lands"
          />
        </Grid>
        <Grid item xs={12} md={6}>
          <ActionCard
            icon={SwapHoriz}
            title="Transfer Management"
            description="Initiate, track, and complete property transfers with blockchain-secured transactions."
            color="#E0115F"
            path="/transfers"
          />
        </Grid>
        <Grid item xs={12} md={6}>
          <ActionCard
            icon={Timeline}
            title="Interactive Map"
            description="Explore properties on an interactive map with satellite imagery and location details."
            color="#B9F2FF"
            path="/map"
          />
        </Grid>
      </Grid>

      <Fab
        color="primary"
        sx={{
          position: 'fixed',
          bottom: 32,
          right: 32,
          background: 'linear-gradient(45deg, #FFD700, #FFA500)',
          color: '#000',
          width: 70,
          height: 70,
          '&:hover': {
            background: 'linear-gradient(45deg, #FFA500, #FFD700)',
            transform: 'scale(1.1)',
            boxShadow: '0 0 30px rgba(255, 215, 0, 0.6)',
          },
          transition: 'all 0.3s ease',
        }}
        onClick={() => navigate('/register-land')}
      >
        <Add sx={{ fontSize: '2rem' }} />
      </Fab>
    </Container>
  );
};

export default Dashboard;
